import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminDashboard = () => {
  const [complaints, setComplaints] = useState([]);
  const [filteredComplaints, setFilteredComplaints] = useState([]);
  const [selectedDepartment, setSelectedDepartment] = useState("All");

  const fetchComplaints = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/admin/complaints");
      if (res.data.success) {
        setComplaints(res.data.complaints);
        filterComplaints(res.data.complaints, selectedDepartment);
      }
    } catch (error) {
      console.error("Error fetching complaints:", error);
    }
  };

  const filterComplaints = (complaintsData, department) => {
    if (department === "All") {
      setFilteredComplaints(complaintsData);
    } else {
      const filtered = complaintsData.filter(
        (complaint) => complaint.department === department
      );
      setFilteredComplaints(filtered);
    }
  };

  const handleDepartmentChange = (e) => {
    const department = e.target.value;
    setSelectedDepartment(department);
    filterComplaints(complaints, department);
  };

  const handleResolve = async (id) => {
    try {
      const res = await axios.put(
        `http://localhost:5000/api/admin/update-status/${id}`,
        { status: "Resolved" }
      );
      if (res.data.success) {
        fetchComplaints(); // Refresh the list after update
      }
    } catch (error) {
      console.error("Error updating status:", error);
    }
  };

  useEffect(() => {
    fetchComplaints();
  }, []);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Admin Dashboard</h2>

      <div className="mb-4">
        <label className="mr-2 font-medium">Filter by Department:</label>
        <select
          value={selectedDepartment}
          onChange={handleDepartmentChange}
          className="p-2 border rounded"
        >
          <option value="All">All</option>
          <option value="Water">Water</option>
          <option value="Electricity">Electricity</option>
          <option value="Sanitation">Sanitation</option>
          <option value="Roads">Roads</option>
          {/* Add more departments if needed */}
        </select>
      </div>

      <div className="grid gap-4">
        {filteredComplaints.map((complaint) => (
          <div
            key={complaint.id}
            className="p-4 border rounded shadow bg-white flex flex-col md:flex-row justify-between items-start md:items-center"
          >
            <div>
              <p>
                <strong>Name:</strong> {complaint.name}
              </p>
              <p>
                <strong>Location:</strong> {complaint.location}
              </p>
              <p>
                <strong>Department:</strong> {complaint.department}
              </p>
              <p>
                <strong>Status:</strong>{" "}
                <span
                  className={
                    complaint.status === "Resolved"
                      ? "text-green-600 font-semibold"
                      : "text-red-600 font-semibold"
                  }
                >
                  {complaint.status}
                </span>
              </p>
              <p>
                <strong>Token:</strong> {complaint.token}
              </p>
              <p>
                <strong>Time:</strong>{" "}
                {new Date(complaint.timestamp).toLocaleString()}
              </p>
            </div>
            {complaint.status !== "Resolved" && (
              <button
                onClick={() => handleResolve(complaint.id)}
                className="mt-4 md:mt-0 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
              >
                Mark as Resolved
              </button>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdminDashboard;
